    ans = distribution(stock(), request())
    if ans[0] == 'YES':
        print('YES')
        for p in ans[1]:
            print(p)
    else:
        print('NO')

def check(s, l):
    for size in l:
        if size not in s:
            return False
        else:
            s[size] -= 1
            if s[size] < 0:
                return False
    return True

